import React from 'react';
import {
    Typography
} from '@material-ui/core';
import {
    Button
} from '@material-ui/core';
import {
    Grid
} from '@material-ui/core';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import Item from './Item.js';
import Scroll from './Scroll.js';

const Experience = () => {
    return ( <
        Grid container direction = "row"
        justify = "flex-start"
        alignItems = "center"
        style = {
            {
                marginLeft: '30px',
                paddingRight: '30px'
            }
        } >

        <
        Grid item xs = {
            6
        } >
        <
        Typography display = "block"
        justifyContent = "center"
        align = "center"
        variant = "h3"
        style = {
            {
                opacity: '100%',
                fontWeight: 'bold',
                fontSize: '40px',
                color: 'white',
                backgroundColor: 'rgba(0,0,0,0.7',
                height: '200px',
                paddingTop: '25%'
            }
        } >
        Work Experience <
        /Typography> <
        /Grid>

        <
        Grid item xs = {
            6
        } >
        <
        Scroll color = 'rgba(205, 255, 219, 0.8)' >
        <
        Item jobTitle = 'Quantum Computing Intern'
        company = 'Riverlane'
        text = 'Working in a software-oriented quantum computing startup in a 10 week internship program. 
        Researching and implementing benchmarking algorithms into Deltaflow.OS using dataflow programming.This internship gave me an insight into quantum computing and working in the industry, largely enhanced by programming skills and taught me industry - level project management and result presentation.
        ' /> <
        Item jobTitle = 'IB Tutor'
        company = 'Elite IB'
        text = 'Tutoring IB Mathematics and Physics of all levels online to students in their last 2 years of high school.
        Preparing materials and worksheets
        for lessons and guiding students in their exam preparation.This job taught me time management, organization and how to present complicated concepts uisng simple lamguage, examples and visuals.
        ' /> <
        Item jobTitle = 'Science Presenter'
        company = 'Fun Scientists'
        text = 'Demonstrating and teaching fun science experiments at local primary schools and events across the UK 
        with the aim of promoting science literacy and sparking interest in young children.Interacting with high profile clients at private events enhancing my presentation and public speaking skills.
        ' /> <
        /Scroll> <
        /Grid>

        <
        /Grid>
    )
}

export default Experience;
